package project.pack.vo;

public class account_couponVO {

	private String rowNum;
	private String memberId;
	private String couponNum;
	private String couponName;
	private String couponDC;
	private String couponMax;
	private String couponExpire;
	private String isExpire;
	
	public account_couponVO() {
		// TODO Auto-generated constructor stub
	}

	public String getRowNum() {
		return rowNum;
	}

	public void setRowNum(String rowNum) {
		this.rowNum = rowNum;
	}
	
	public String getMemberId() {
		return memberId;
	}

	public void setMemberId(String memberId) {
		this.memberId = memberId;
	}

	public String getCouponNum() {
		return couponNum;
	}

	public void setCouponNum(String couponNum) {
		this.couponNum = couponNum;
	}

	public String getCouponName() {
		return couponName;
	}

	public void setCouponName(String couponName) {
		this.couponName = couponName;
	}

	public String getCouponDC() {
		return couponDC;
	}

	public void setCouponDC(String couponDC) {
		this.couponDC = couponDC;
	}

	public String getCouponMax() {
		return couponMax;
	}

	public void setCouponMax(String couponMax) {
		this.couponMax = couponMax;
	}

	public String getCouponExpire() {
		return couponExpire;
	}

	public void setCouponExpire(String couponExpire) {
		this.couponExpire = couponExpire;
	}

	public String getIsExpire() {
		return isExpire;
	}

	public void setIsExpire(String isExpire) {
		this.isExpire = isExpire;
	}
	
}
